import { useEffect, useState } from 'react';

import logo from '../../images/assets/logo.svg';
import moon from '../../images/assets/icon-moon.svg';
import sun from '../../images/assets/icon-sun.svg';
import avatar from '../../images/assets/image-avatar.jpg';


const SideNav = () => {
    const [theme, setTheme] = useState({lightMode: true, darkMode: false});

    const handleThemChange = () => {
        setTheme({
            lightMode: !theme.lightMode,
            darkMode: !theme.darkMode
        });
    };

    return (
        <div className='side-nav-container'>
            <img className='side-nav-logo' src={logo} alt='logo'></img>

            <div className='side-nav'>
                
            </div>
        </div>
    ); 
};



export default SideNav;
